@NgModule({
  declarations: [
    AppComponent,
    SaveEntryComponent,
    ListEntryComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    FormsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
